function msToTime(duration) {

    /* heure depuis minuit
    prendre heure actuel et soustraire pour avoir delta temps
     */

    var now = new Date();
    var frTime=now.toLocaleTimeString('fr-FR').split(":");

    //node.warn((parseInt(frTime[0])+1)+":"+parseInt(frTime[1])+":"+parseInt(frTime[2]));

    var nbMilli=((parseInt(frTime[0])+1)*3600)+(parseInt(frTime[1])*60)+(parseInt(frTime[2]));
    var diff = duration-nbMilli;   
    //node.warn("duration: "+duration+"  nbMilli: "+ nbMilli )

    var minutes = Math.floor(diff / 60);
    var hours = Math.floor(diff / 3600);
    //node.warn("minutes: "+minutes)
    let desc="";
  if(hours > 0)
  {

      minutes=minutes-(hours*60);
      if(minutes<10){
         minutes= "0"+minutes;
      }
      desc=hours+"h"+minutes;

  } else {

      desc=minutes +" Min"

  };




  return desc ;
}

